import MUIDataTable from "mui-datatables";
import React, { useState } from "react";
import ReactDOM from "react-dom";
import { ThemeProvider } from "@mui/material/styles";
import { createTheme } from "@mui/material/styles";
import InputLabel from "@mui/material/InputLabel";
import MenuItem from "@mui/material/MenuItem";
import FormControl from "@mui/material/FormControl";
import Select from "@mui/material/Select";
import { CacheProvider } from "@emotion/react";
import createCache from "@emotion/cache";

const muiCache = createCache({
  key: "mui-datatables",
  prepend: true,
});

function App() {
  const [responsive, setResponsive] = useState("vertical");
  const [tableBodyHeight, setTableBodyHeight] = useState("100%");
  const [tableBodyMaxHeight, setTableBodyMaxHeight] = useState("100%");
  const [searchBtn, setSearchBtn] = useState(true);
  const [downloadBtn, setDownloadBtn] = useState(true);
  const [printBtn, setPrintBtn] = useState(true);
  const [viewColumnBtn, setViewColumnBtn] = useState(true);
  const [filterBtn, setFilterBtn] = useState(true);

  const columns = [
    { name: "Name", options: { filterOptions: { fullWidth: true } } },
    "Title",
    "About",
  ];

  const options = {
    search: searchBtn,
    download: downloadBtn,
    print: printBtn,
    viewColumns: viewColumnBtn,
    filter: filterBtn,
    filterType: "dropdown",
    responsive,
    tableBodyHeight,
    tableBodyMaxHeight,
    onTableChange: (action, state) => {
      console.log(action);
      console.dir(state);
    },
  };

  const data = [
    [
      "Adbhutanand Swami (અદભૂતાનંદ સ્વામી)",
      "Business Analyst",
      "-Chhatralay Bhutprva vidhyarthi\n -diksha=>2003\n -Medical vibhag Seva",
    ],
    [
      "Aiden Lloyd",
      "Business Consultant for an International Company and CEO of Tony's Burger Palace",
      "Dallas",
    ],
    [
      "Adbhutanand Swami (અદભૂતાનંદ સ્વામી)",
      "Business Analyst",
      "-Chhatralay Bhutprva vidhyarthi\n -diksha=>2003\n -Medical vibhag Seva",
    ],
    [
      "Adbhutanand Swami (અદભૂતાનંદ સ્વામી)",
      "Business Analyst",
      "-Chhatralay Bhutprva vidhyarthi\n -diksha=>2003\n -Medical vibhag Seva",
    ],
    [
      "Adbhutanand Swami (અદભૂતાનંદ સ્વામી)",
      "Business Analyst",
      "-Chhatralay Bhutprva vidhyarthi\n -diksha=>2003\n -Medical vibhag Seva",
    ],
    [
      "Adbhutanand Swami (અદભૂતાનંદ સ્વામી)",
      "Business Analyst",
      "-Chhatralay Bhutprva vidhyarthi\n -diksha=>2003\n -Medical vibhag Seva",
    ],
    [
      "Adbhutanand Swami (અદભૂતાનંદ સ્વામી)",
      "Business Analyst",
      "-Chhatralay Bhutprva vidhyarthi\n -diksha=>2003\n -Medical vibhag Seva",
    ],
    [
      "Adbhutanand Swami (અદભૂતાનંદ સ્વામી)",
      "Business Analyst",
      "-Chhatralay Bhutprva vidhyarthi\n -diksha=>2003\n -Medical vibhag Seva",
    ],
    [
      "Adbhutanand Swami (અદભૂતાનંદ સ્વામી)",
      "Business Analyst",
      "-Chhatralay Bhutprva vidhyarthi\n -diksha=>2003\n -Medical vibhag Seva",
    ],
  ];

  return (
    <CacheProvider value={muiCache}>
      <ThemeProvider theme={createTheme()}>
        <InputLabel id="demo-simple-select-label">Responsive Option</InputLabel>

        <InputLabel id="demo-simple-select-label">Search Button</InputLabel>
        <Select
          labelId="demo-simple-select-label"
          id="demo-simple-select"
          value={searchBtn}
          style={{ width: "200px", marginBottom: "10px" }}
          onChange={(e) => setSearchBtn(e.target.value)}
        >
          <MenuItem value={"true"}>{"true"}</MenuItem>
          <MenuItem value={"false"}>{"false"}</MenuItem>
          <MenuItem value={"disabled"}>disabled</MenuItem>
        </Select>
        <FormControl>
          <InputLabel id="demo-simple-select-label">Download Button</InputLabel>
          <Select
            labelId="demo-simple-select-label"
            id="demo-simple-select"
            value={downloadBtn}
            style={{ width: "200px", marginBottom: "10px" }}
            onChange={(e) => setDownloadBtn(e.target.value)}
          >
            <MenuItem value={"true"}>{"true"}</MenuItem>
            <MenuItem value={"false"}>{"false"}</MenuItem>
            <MenuItem value={"disabled"}>disabled</MenuItem>
          </Select>
        </FormControl>
        <FormControl>
          <InputLabel id="demo-simple-select-label">Print Button</InputLabel>
          <Select
            labelId="demo-simple-select-label"
            id="demo-simple-select"
            value={printBtn}
            style={{ width: "200px", marginBottom: "10px" }}
            onChange={(e) => setPrintBtn(e.target.value)}
          >
            <MenuItem value={"true"}>{"true"}</MenuItem>
            <MenuItem value={"false"}>{"false"}</MenuItem>
            <MenuItem value={"disabled"}>disabled</MenuItem>
          </Select>
        </FormControl>
        <FormControl>
          <InputLabel id="demo-simple-select-label">
            View Column Button
          </InputLabel>
          <Select
            labelId="demo-simple-select-label"
            id="demo-simple-select"
            value={viewColumnBtn}
            style={{ width: "200px", marginBottom: "10px" }}
            onChange={(e) => setViewColumnBtn(e.target.value)}
          >
            <MenuItem value={"true"}>{"true"}</MenuItem>
            <MenuItem value={"false"}>{"false"}</MenuItem>
            <MenuItem value={"disabled"}>disabled</MenuItem>
          </Select>
        </FormControl>
        <FormControl>
          <InputLabel id="demo-simple-select-label">Filter Button</InputLabel>
          <Select
            labelId="demo-simple-select-label"
            id="demo-simple-select"
            value={filterBtn}
            style={{ width: "200px", marginBottom: "10px" }}
            onChange={(e) => setFilterBtn(e.target.value)}
          >
            <MenuItem value={"true"}>{"true"}</MenuItem>
            <MenuItem value={"false"}>{"false"}</MenuItem>
            <MenuItem value={"disabled"}>disabled</MenuItem>
          </Select>
        </FormControl>
        <MUIDataTable
          title={"ACME Employee list"}
          data={data}
          columns={columns}
          options={options}
        />
      </ThemeProvider>
    </CacheProvider>
  );
}

ReactDOM.render(<App />, document.getElementById("root"));
